import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import React from "react";
import Slider from "react-slick";
import './carasoul.css';

const CarouselComponent = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 2,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <div style={{ width: "80%", margin: "auto" }}>
      <Slider {...settings}>
        <div><img src="https://via.placeholder.com/800x400?text=Slide+1" alt="1" /></div>
        <div><img src="https://via.placeholder.com/800x400?text=Slide+2" alt="2" /></div>
        <div><img src="https://via.placeholder.com/800x400?text=Slide+3" alt="3" /></div>
        <div><img src="https://via.placeholder.com/800x400?text=Slide+3" alt="3" /></div><div><img src="https://via.placeholder.com/800x400?text=Slide+3" alt="3" /></div>
      </Slider>
    </div>
  );
};

export default CarouselComponent;
